const App=()=>{

  const [exp,setExp]=useState({});

  const [zipError,setZipError]=useState('');
  const [amiData,setAmiData]=useState(null);

  // Get county limits
  const getCountyLimit=(fips,units)=>{
    const u=parseInt(units)||1;
    if(highCostCounties[fips]) return highCostCounties[fips].l[u-1];
    return BASELINE[u];
  };

  // Check if high-cost area (for 120% vs 100% AMI threshold)
  const isHighCostArea=(fips)=>{
    return !!highCostCounties[fips];
  };

  // Determine if loan is high balance
  const isHighBalance=(loanAmt,fips,units)=>{
    const u=parseInt(units)||1;
    const baseline=BASELINE[u];
    const countyLimit=getCountyLimit(fips,units);
    return loanAmt>baseline && loanAmt<=countyLimit;
  };

  // ZIP lookup via API
  const handleZip=async(zip)=>{
    setF(p=>({...p,zip,incomeLevel:''}));
    setZipError('');
    setAmiData(null);
    
    if(zip.length===5 && /^d{5}$/.test(zip)){
      setZipLoading(true);
      try{
        const res=await fetch('https://api.zippopotam.us/us/'+zip);
        if(res.ok){
          const data=await res.json();
          const place=data.places[0];
          const stateAbbr=place['state abbreviation'];
          const city=place['place name'];
          
          const fccRes=await fetch('https://geo.fcc.gov/api/census/area?lat='+place.latitude+'&lon='+place.longitude+'&format=json');
          if(fccRes.ok){
            const fccData=await fccRes.json();
            if(fccData.results && fccData.results.length>0){
              const fips=fccData.results[0].county_fips;
              const countyName=fccData.results[0].county_name;
              setF(p=>({...p,state:stateAbbr,city:city,county:countyName,fips:fips}));
              
              // Set AMI data for this county
              if(amiLookup[fips]){
                setAmiData(amiLookup[fips]);
              }
            }
          }else{
            setF(p=>({...p,state:stateAbbr,city:city,county:'',fips:''}));
          }
        }else{
          setZipError('ZIP not found');
        }
      }catch(e){
        setZipError('Lookup failed');
      }
      setZipLoading(false);
    }
  };

  // Auto-calc loan amount
  const handlePrice=(v)=>{
    setF(p=>{
      const upd={...p,price:v};
      if(v&&p.ltv) upd.loanAmt=Math.round(parseFloat(v)*parseFloat(p.ltv)/100);
      return upd;
    });
  };
  const handleLtv=(v)=>{
    setF(p=>{
      const upd={...p,ltv:v};
      if(v&&p.price) upd.loanAmt=Math.round(parseFloat(p.price)*parseFloat(v)/100);
      return upd;
    });
  };

  // FICO x LTV matrices
  const ficoLtvPurch={780:[0,0,0,0,-.375,-.375,-.25],760:[0,0,0,-.25,-.625,-.625,-.5],740:[0,0,-.125,-.375,-.875,-1,-.75],720:[0,0,-.25,-.75,-1.25,-1.25,-1],700:[0,0,-.375,-.875,-1.375,-1.5,-1.25],680:[0,0,-.625,-1.125,-1.75,-1.875,-1.5],660:[0,0,-.75,-1.375,-1.875,-2.125,-1.75],640:[0,0,-1.125,-1.5,-2.25,-2.5,-2],620:[0,-.125,-1.5,-2.125,-2.75,-2.875,-2.625]};

  const ficoLtvCO={780:[-.375,-.375,-.625,-.875,-1.375,-1.375,-1.375],760:[-.375,-.375,-.875,-1.25,-1.875,-1.875,-1.875],740:[-.375,-.375,-1,-1.625,-2.375,-2.375,-2.375],720:[-.375,-.5,-1.375,-2,-2.75,-2.75,-2.75],700:[-.375,-.5,-1.625,-2.625,-3.25,-3.25,-3.25],680:[-.375,-.625,-2,-2.875,-3.75,-3.75,-3.75],660:[-.375,-.875,-2.75,-4,-4.75,-4.75,-4.75],640:[-.375,-1.375,-3.125,-4.625,-5.125,-5.125,-5.125],620:[-.375,-1.375,-3.375,-4.875,-5.125,-5.125,-5.125]};

  const subFinAdj=[-.625,-.625,-.625,-.875,-1.125,-1.125,-1.125];

  const getLtvBucket=(ltv)=>{if(ltv<=60)return 0;if(ltv<=70)return 1;if(ltv<=75)return 2;if(ltv<=80)return 3;if(ltv<=85)return 4;if(ltv<=90)return 5;return 6;};
  const getFicoBucket=(fico)=>{if(fico>=780)return 780;if(fico>=760)return 760;if(fico>=740)return 740;if(fico>=720)return 720;if(fico>=700)return 700;if(fico>=680)return 680;if(fico>=660)return 660;if(fico>=640)return 640;return 620;};

  const getPayup=(rate,state,occ,aus)=>{
    let tbl={};
    if(state==='NY'){if(occ==='inv')tbl=payups.nyI;else if(occ==='sec')tbl=payups.nyS;else tbl=payups.nyP;}
    else if(state==='FL'){if(occ==='inv')tbl=aus==='DU'?payups.flID:payups.flIL;else if(occ==='sec')tbl=aus==='DU'?payups.flSD:payups.flSL;else tbl=payups.flPL;}
    else{if(occ==='inv')tbl=payups.invO;else if(occ==='sec')tbl=payups.secO;else return 0;}
    if(tbl[rate]!==undefined)return tbl[rate];
    const rs=Object.keys(tbl).map(Number).sort((a,b)=>a-b);
    if(rs.length===0)return 0;
    let cl=rs[0];for(let i=0;i<rs.length;i++)if(Math.abs(rs[i]-rate)<Math.abs(cl-rate))cl=rs[i];
    return tbl[cl]||0;
  };

  // Check if LLPAs should be waived per Fannie Mae guidelines
  // 1. HomeReady loans - ALL LLPAs waived
  // 2. First-time homebuyers with income <=100% AMI (or <=120% in high-cost) - ALL LLPAs waived
  const shouldWaiveLLPA=(item)=>{
    // HomeReady products always get LLPA waiver
    if(item && (item.p==='HomeReady'||item.p==='HR ARM')) return {waived:true,reason:'HomeReady'};
    
    // HomePossible (Freddie Mac equivalent) also gets LLPA waiver
    if(item && item.p==='HomePoss') return {waived:true,reason:'HomePossible'};
    
    // First-time buyer at/below AMI threshold
    if(f.firstTimeBuyer==='yes'){
      // 'low' = <=80% AMI (qualifies)
      // 'mid100' = 80-100% AMI (qualifies)  
      // 'mid120' = 100-120% AMI in high-cost (qualifies)
      if(f.incomeLevel==='low'||f.incomeLevel==='mid100'||f.incomeLevel==='mid120'){
        return {waived:true,reason:'First-Time Buyer ?'+((f.incomeLevel==='mid120')?'120':'100')+'% AMI'};
      }
    }
    
    return {waived:false,reason:null};
  };

  const calcAdj=(base,item)=>{
    let adj=0,bd=[];
    const fico=parseInt(f.fico)||0,ltv=parseFloat(f.ltv)||0,loanAmt=parseFloat(f.loanAmt)||0;
    const ltvB=getLtvBucket(ltv),ficoB=getFicoBucket(fico);
    const isConv=item.cat.indexOf('conv')>-1||item.cat.indexOf('hb')>-1||item.cat.indexOf('reno')>-1;
    
    // Check if LLPAs should be waived
    const waiverCheck=shouldWaiveLLPA(item);
    const waiveLLPA=waiverCheck.waived&&isConv;
    const waiverReason=waiverCheck.reason;
    
    if(waiveLLPA){
      bd.push({l:'? LLPA WAIVED ('+waiverReason+')',v:0});
    }else{
      // FICO x LTV
      if(isConv&&fico&&ltv){
        let mx=f.purpose==='purchase'?ficoLtvPurch:f.purpose==='cashout'?ficoLtvCO:ficoLtvRefi;
        if(mx[ficoB]){let v=mx[ficoB][ltvB]||0;if(v!==0){adj+=v;bd.push({l:'FICO/LTV',v});}}
      }
      // Property type
      if(isConv){
        if(f.prop==='condo'){let v=condoAdj[ltvB]||0;if(v!==0){adj+=v;bd.push({l:'Condo',v});}}
        if(f.prop==='mfg'){adj+=mfgAdj;bd.push({l:'Manufactured',v:mfgAdj});}
        if(parseInt(f.units)>1){let v=multiAdj[ltvB]||0;if(v!==0){adj+=v;bd.push({l:'Multi-Unit',v});}}
      }
      // Occupancy
      if(isConv){
        if(f.occ==='inv'){let v=invAdj[ltvB]||-1.125;adj+=v;bd.push({l:'Investment',v});}
        else if(f.occ==='sec'){let v=secAdj[ltvB]||-1.125;adj+=v;bd.push({l:'Second Home',v});}
      }
      // Subordinate financing
      if(isConv&&f.subFin){let v=subFinAdj[ltvB]||-.625;adj+=v;bd.push({l:'Sub Fin',v});}
      // Loan amount
      if(isConv&&loanAmt>0){
        for(let i=0;i<loanAdj.length;i++){
          if(loanAmt>=loanAdj[i].min&&loanAmt<=loanAdj[i].max&&loanAdj[i].val!==0){adj+=loanAdj[i].val;bd.push({l:'Loan Amt',v:loanAdj[i].val});break;}
        }
      }
      // State adj
      if(isConv&&f.state&&stAdj[f.state]&&stAdj[f.state]!==0){adj+=stAdj[f.state];bd.push({l:'State ('+f.state+')',v:stAdj[f.state]});}
    }
    
    // These always apply even with waiver
    // Specials
    if(isConv&&sp.conv!==0){adj+=sp.conv;bd.push({l:'Conv Special',v:sp.conv});}
    if((item.cat==='govt'||item.cat==='govt-hb')&&sp.govt!==0){adj+=sp.govt;bd.push({l:'Govt Special',v:sp.govt});}
    // FICO>740
    if(isConv&&fico>740&&sp.fico740!==0&&!waiveLLPA){adj+=sp.fico740;bd.push({l:'FICO>740',v:sp.fico740});}
    // Pay-up
    if(isConv&&item.t==='30Y'){let v=getPayup(item.r,f.state,f.occ,f.aus);if(v!==0){adj+=v;bd.push({l:'Pay-Up',v});}}
    // Escrow
    if(f.escrow&&isConv){let v=(f.state==='CA'||f.state==='NY')?misc.escCANY:misc.escOther;if(v!==0){adj+=v;bd.push({l:'Escrow Waiver',v});}}
    
    return {adj,final:base+adj,bd,waived:waiveLLPA,waiverReason:waiverReason};
  };

  // Get income level options based on AMI
  const getIncomeOptions=()=>{
    if(!amiData) return null;
    const hc=isHighCostArea(f.fips);

      highCost: hc
    };
  };

    const countyLimit=f.fips?getCountyLimit(f.fips,f.units):BASELINE[parseInt(f.units)||1];
    
    return rates.filter(item=>{

      // HomeReady/HomePossible: Only show if income <= 80% AMI

        if(!f.incomeLevel) return false;
        // Only 'low' (<=80%) and 'mid100' (80-100%) qualify
        if(f.incomeLevel!=='low'&&f.incomeLevel!=='mid100') return false;
      }
      
      // Product filter
      if(f.prodFilter!=='all'&&item.p!==f.prodFilter)return false;
      // Category filter
      if(f.catFilter!=='all'){
        if(f.catFilter==='govt'&&item.cat.indexOf('govt')===-1)return false;
        if(f.catFilter==='conv'&&item.cat.indexOf('conv')===-1&&item.cat.indexOf('hb')===-1)return false;
        if(f.catFilter==='hb'&&item.cat.indexOf('hb')===-1)return false;
        if(f.catFilter==='reno'&&item.cat.indexOf('reno')===-1)return false;
        if(f.catFilter==='nqm'&&item.cat.indexOf('nqm')===-1)return false;
      }
      // Auto-filter HB products based on loan amount
      if(loanAmt>0&&f.fips){
        const baseline=BASELINE[parseInt(f.units)||1];
        const countyLimit=getCountyLimit(f.fips,f.units);
        if(item.cat.indexOf('hb')>-1&&loanAmt<=baseline)return false;
        if(item.cat.indexOf('hb')===-1&&item.cat.indexOf('conv')>-1&&loanAmt>baseline&&loanAmt<=countyLimit)return false;
        if(loanAmt>countyLimit&&(item.cat.indexOf('conv')>-1||item.cat.indexOf('hb')>-1))return false;
      }
      return true;
    }).map(item=>{
      const base=item['l'+f.lock]||item.l30;
      const calc=calcAdj(base,item);
      const afterComp=calc.final-f.comp;
      const disc=loanAmt>0?(100-afterComp)*loanAmt/100:0;
      const mo=loanAmt>0?(loanAmt*(item.r/100/12)*Math.pow(1+item.r/100/12,item.t==='15Y'?180:360))/(Math.pow(1+item.r/100/12,item.t==='15Y'?180:360)-1):0;
      const total=disc+(mo*(item.t==='15Y'?180:360)-loanAmt);
      return {...item,base,calc,afterComp,disc,mo,total};
    }).sort((a,b)=>a.total-b.total);
  },[f]);

  const best=filtered.length>0&&f.loanAmt?filtered[0]:null;
  const loanAmt=parseFloat(f.loanAmt)||0;
  const countyLimit=f.fips?getCountyLimit(f.fips,f.units):BASELINE[parseInt(f.units)||1];
  const isHB=f.fips?isHighBalance(loanAmt,f.fips,f.units):false;
  const isJumbo=f.fips&&loanAmt>countyLimit;
  const llpaWaivedCheck=shouldWaiveLLPA(null);
  const llpaWaived=llpaWaivedCheck.waived||(f.incomeLevel==='low'); // low income = HomeReady eligible = waived

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-50 to-indigo-100 p-4">
      <div className="max-w-7xl mx-auto">
        <div className="bg-white rounded-lg shadow-lg p-4 mb-4">
          <h1 className="text-xl font-bold text-indigo-800">TPO Go Complete Rate Sifter</h1>
          <p className="text-sm text-gray-600">Effective: 12/30/2025 | All Products | FHFA 2026 Limits | AMI Income Limits</p>
          {f.fips && <p className="text-xs mt-1"><span className="font-semibold">{f.city}, {f.county}, {f.state}</span> | County Limit ({f.units}-unit): <span className="font-bold text-green-700">{'$'}{countyLimit.toLocaleString()}</span> | {isJumbo?<span className="text-red-600 font-bold">?? JUMBO</span>:isHB?<span className="text-purple-600 font-bold">? HIGH BALANCE</span>:<span className="text-green-600 font-bold">? CONFORMING</span>}</p>}
          {f.incomeLevel==='low' && <p className="text-xs mt-1 bg-green-100 text-green-800 px-2 py-1 rounded inline-block">? HomeReady/HomePossible: ALL LLPAs WAIVED</p>}
          {llpaWaivedCheck.waived && f.incomeLevel!=='low' && <p className="text-xs mt-1 bg-green-100 text-green-800 px-2 py-1 rounded inline-block">? First-Time Buyer ?{incomeOpts?.highCost?'120':'100'}% AMI: ALL LLPAs WAIVED on Conventional</p>}
        </div>
        
        <div className="bg-white rounded-lg shadow-lg p-4 mb-4">
          <div className="grid grid-cols-2 md:grid-cols-4 lg:grid-cols-6 gap-3 text-sm">
            <div><label className="block font-medium mb-1">ZIP Code {zipLoading&&<span className="text-blue-500 ml-1">?</span>}</label><input value={f.zip} onChange={e=>handleZip(e.target.value)} placeholder="Enter ZIP" maxLength="5" className="w-full p-2 border rounded"/>{zipError&&<span className="text-red-500 text-xs">{zipError}</span>}</div>
            <div><label className="block font-medium mb-1">State</label><input value={f.state} readOnly className="w-full p-2 border rounded bg-gray-50"/></div>
            <div><label className="block font-medium mb-1">County</label><input value={f.county} readOnly className="w-full p-2 border rounded bg-gray-50"/></div>
            <div><label className="block font-medium mb-1">FICO</label><input type="number" value={f.fico} onChange={e=>setF(p=>({...p,fico:e.target.value}))} placeholder="740" className="w-full p-2 border rounded"/></div>
            <div><label className="block font-medium mb-1">Purchase Price</label><input type="number" value={f.price} onChange={e=>handlePrice(e.target.value)} placeholder="800000" className="w-full p-2 border rounded"/></div>
            <div><label className="block font-medium mb-1">LTV %</label><input type="number" value={f.ltv} onChange={e=>handleLtv(e.target.value)} placeholder="80" className="w-full p-2 border rounded"/></div>
            <div><label className="block font-medium mb-1">Loan Amount</label><input type="number" value={f.loanAmt} onChange={e=>setF(p=>({...p,loanAmt:e.target.value}))} className="w-full p-2 border rounded"/></div>
            <div><label className="block font-medium mb-1">Loan Purpose</label><select value={f.purpose} onChange={e=>setF(p=>({...p,purpose:e.target.value}))} className="w-full p-2 border rounded"><option value="purchase">Purchase</option><option value="rateterm">Rate/Term Refi</option><option value="cashout">Cash-Out Refi</option></select></div>
            <div><label className="block font-medium mb-1">Units</label><select value={f.units} onChange={e=>setF(p=>({...p,units:e.target.value}))} className="w-full p-2 border rounded"><option value="1">1 Unit</option><option value="2">2 Units</option><option value="3">3 Units</option><option value="4">4 Units</option></select></div>
            <div><label className="block font-medium mb-1">Property Type</label><select value={f.prop} onChange={e=>setF(p=>({...p,prop:e.target.value}))} className="w-full p-2 border rounded"><option value="sf">Single Family</option><option value="condo">Condo</option><option value="mfg">Manufactured</option></select></div>
            <div><label className="block font-medium mb-1">Occupancy</label><select value={f.occ} onChange={e=>setF(p=>({...p,occ:e.target.value}))} className="w-full p-2 border rounded"><option value="primary">Primary</option><option value="sec">Second Home</option><option value="inv">Investment</option></select></div>
            <div><label className="block font-medium mb-1">Lock Period</label><select value={f.lock} onChange={e=>setF(p=>({...p,lock:e.target.value}))} className="w-full p-2 border rounded"><option value="15">15 Day</option><option value="30">30 Day</option><option value="45">45 Day</option><option value="60">60 Day</option></select></div>
            
            {/* Income Level Dropdown - Dynamic based on county AMI */}
            {incomeOpts && (
              <div className="col-span-2"><label className="block font-medium mb-1 text-indigo-700">Borrower Income Level ?</label>
                <select value={f.incomeLevel} onChange={e=>setF(p=>({...p,incomeLevel:e.target.value}))} className="w-full p-2 border-2 border-indigo-300 rounded bg-indigo-50">
                  <option value="">-- Select Income Level --</option>
                  <option value="low">? {'$'}{incomeOpts.low.toLocaleString()} (?80% AMI)</option>
                  {incomeOpts.highCost ? (
                    <>
                      <option value="mid100">{'$'}{incomeOpts.low.toLocaleString()} - {'$'}{incomeOpts.ami100.toLocaleString()} (80-100% AMI)</option>
                      <option value="mid120">{'$'}{incomeOpts.ami100.toLocaleString()} - {'$'}{incomeOpts.mid.toLocaleString()} (100-120% AMI)</option>
                    </>
                  ) : (
                    <option value="mid100">{'$'}{incomeOpts.low.toLocaleString()} - {'$'}{incomeOpts.ami100.toLocaleString()} (80-100% AMI)</option>
                  )}
                  <option value="high">&gt; {'$'}{incomeOpts.mid.toLocaleString()} (&gt;{incomeOpts.highCost?'120':'100'}% AMI)</option>
                </select>
                {f.incomeLevel==='low'&&<p className="text-xs text-green-600 mt-1">? HomeReady/HomePossible eligible (LLPAs WAIVED) + RefiNow/Possible eligible</p>}
                {f.incomeLevel==='mid100'&&<p className="text-xs text-blue-600 mt-1">{f.purpose==='rateterm'?'? RefiNow/Possible eligible | ':''}If First-Time Buyer: LLPAs waived</p>}
                {f.incomeLevel==='mid120'&&<p className="text-xs text-blue-600 mt-1">?? RefiNow/Possible NOT eligible | If First-Time Buyer: LLPAs waived</p>}
              </div>
            )}
            
            {/* First-Time Buyer - Only show if income is in middle brackets */}
            {(f.incomeLevel==='mid100'||f.incomeLevel==='mid120') && (
              <div><label className="block font-medium mb-1 text-indigo-700">First-Time Buyer?</label>
                <select value={f.firstTimeBuyer} onChange={e=>setF(p=>({...p,firstTimeBuyer:e.target.value}))} className="w-full p-2 border-2 border-indigo-300 rounded bg-indigo-50">
                  <option value="no">No</option>
                  <option value="yes">Yes</option>
                </select>
                {f.firstTimeBuyer==='yes'&&<p className="text-xs text-green-600 mt-1">? LLPAs WAIVED!</p>}
              </div>
            )}
            
            <div><label className="block font-medium mb-1">Broker Comp %</label><input type="number" step="0.125" value={f.comp} onChange={e=>setF(p=>({...p,comp:parseFloat(e.target.value)||0}))} className="w-full p-2 border rounded"/></div>
            <div><label className="block font-medium mb-1">AUS (FL)</label><select value={f.aus} onChange={e=>setF(p=>({...p,aus:e.target.value}))} className="w-full p-2 border rounded"><option value="LP">LP</option><option value="DU">DU</option></select></div>
            <div><label className="block font-medium mb-1">Category</label><select value={f.catFilter} onChange={e=>setF(p=>({...p,catFilter:e.target.value}))} className="w-full p-2 border rounded"><option value="all">All</option><option value="govt">Government</option><option value="conv">Conventional</option><option value="hb">High Balance</option><option value="reno">Renovation</option><option value="nqm">Non-QM</option></select></div>
            <div className="flex items-center pt-6"><input type="checkbox" checked={f.escrow} onChange={e=>setF(p=>({...p,escrow:e.target.checked}))} className="mr-2 h-4 w-4"/><label>Escrow Waiver</label></div>
            <div className="flex items-center pt-6"><input type="checkbox" checked={f.subFin} onChange={e=>setF(p=>({...p,subFin:e.target.checked}))} className="mr-2 h-4 w-4"/><label>Sub Financing</label></div>
          </div>
        </div>

        <div className="bg-white rounded-lg shadow-lg p-4">
          <h2 className="font-semibold mb-2 text-indigo-800">Results ({filtered.length} products) {llpaWaived&&<span className="text-green-600 text-sm ml-2">? LLPAs Waived</span>}</h2>
          {isJumbo && <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-2 rounded mb-3">?? Loan exceeds county limit - Jumbo not available</div>}
          {!f.incomeLevel && f.fips && <div className="bg-yellow-100 border border-yellow-400 text-yellow-700 px-4 py-2 rounded mb-3">? Select income level above to see HomeReady/HomePossible products</div>}
          <div className="overflow-x-auto">
            <table className="w-full text-sm">
              <thead className="bg-indigo-50">
                <tr><th className="p-2 text-left">Product</th><th className="p-2">Term</th><th className="p-2">Rate</th><th className="p-2">Base</th><th className="p-2">Adj</th><th className="p-2">Final</th>{f.loanAmt&&<><th className="p-2">Cost/Credit</th><th className="p-2">P&I</th><th className="p-2">Total Cost</th></>}</tr>
              </thead>
              <tbody>
                {filtered.slice(0,50).map((item,i)=>(
                  <React.Fragment key={i}>
                    <tr onClick={()=>setExp(p=>({...p,[i]:!p[i]}))} className={(best&&item.r===best.r&&item.p===best.p?'bg-yellow-50 border-2 border-yellow-400 ':'border-b hover:bg-gray-50 ')+'cursor-pointer'+(item.calc.waived?' bg-green-50':'')}>
                      <td className="p-2"><span className={'px-2 py-1 rounded text-xs font-semibold '+(item.cat.indexOf('govt')>-1?'bg-blue-100 text-blue-800':item.cat.indexOf('hb')>-1?'bg-purple-100 text-purple-800':item.cat.indexOf('nqm')>-1?'bg-red-100 text-red-800':item.cat.indexOf('-ami')>-1?'bg-yellow-100 text-yellow-800':'bg-green-100 text-green-800')}>{item.p}</span>{best&&item===best&&<span className="ml-1 px-1 py-0.5 bg-yellow-400 text-xs font-bold rounded">BEST</span>}{item.calc.waived&&<span className="ml-1 text-green-600 text-xs">?</span>}</td>
                      <td className="p-2 text-center">{item.t}</td>
                      <td className="p-2 text-center font-semibold">{item.r.toFixed(3)}%</td>
                      <td className="p-2 text-center">{item.base.toFixed(3)}</td>
                      <td className="p-2 text-center"><span className={item.calc.adj>=0?'text-green-600':'text-red-600'}>{item.calc.adj>=0?'+':''}{item.calc.adj.toFixed(3)}</span></td>
                      <td className="p-2 text-center font-bold"><span className={item.afterComp>=100?'text-green-600':'text-red-600'}>{item.afterComp.toFixed(3)}</span></td>
                      {f.loanAmt&&<><td className="p-2 text-center"><span className={item.disc<0?'text-green-600':'text-red-600'}>{'$'}{Math.abs(item.disc).toLocaleString(undefined,{maximumFractionDigits:0})}</span><div className="text-xs text-gray-500">{item.disc<0?'Credit':'Cost'}</div></td>
                      <td className="p-2 text-center">{'$'}{item.mo.toLocaleString(undefined,{maximumFractionDigits:0})}</td>
                      <td className="p-2 text-center font-bold">{'$'}{item.total.toLocaleString(undefined,{maximumFractionDigits:0})}</td></>}
                    </tr>
                    {exp[i]&&item.calc.bd.length>0&&<tr className="bg-gray-50"><td colSpan="9" className="p-2"><div className="grid grid-cols-2 md:grid-cols-4 gap-2">{item.calc.bd.map((a,j)=><div key={j} className={'flex justify-between p-1 rounded border text-xs '+(a.l.indexOf('WAIVED')>-1?'bg-green-100 border-green-300':'bg-white')}><span>{a.l}</span><span className={a.v>=0?'text-green-600':'text-red-600'}>{a.v>=0?'+':''}{a.v.toFixed(3)}</span></div>)}<div className="flex justify-between bg-white p-1 rounded border text-xs"><span>Broker Comp</span><span className="text-red-600">-{f.comp.toFixed(3)}</span></div></div></td></tr>}
                  </React.Fragment>
                ))}
              </tbody>
            </table>
          </div>
        </div>

        <div className="mt-4 bg-indigo-600 text-white rounded-lg p-3 text-center text-sm">
          TPO Go Wholesale | Lock Desk: (860) 676-8003 | tpogo.com
        </div>
      </div>
    </div>
  );
};
ReactDOM.createRoot(document.getElementById("root")).render(<App/>);
</script></body></html>
